  const [count, setCount] = useState(0);

  return (
    <>
      <div>
        <p>Click {count} times</p>
        <button onClick={() => setCount(count + 1)} >
          Click me
        </button>
      </div>
      <br/>
      <div>welcome to my page !</div>
      <p>Look my daily</p>
      <Link href="/post/blog/diary">
        <button>Look</button>
      </Link>
    </>
  );
};

BlogList.getInitialProps = async () => {
  return {};
};

export default BlogList;
